// src/components/Header.js
import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>AI-Powered Learning Platform</h1>
      <nav>
        <a href="/">Home</a>
        <a href="/login">Login</a>
        <a href="/register">Register</a>
        <a href="/courses">Courses</a>
      </nav>
    </header>
  );
};

export default Header;
